import React from 'react';
import './Profile.scss';

const Profile = () => {
  return (
    <div className="prof">
      <div className="container">
        <div className="prof__header">
          <h1 className="prof__header-nick"></h1>
        </div>
      </div>
    </div>
  );
};
export default Profile;
